// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

contract CodeCloudsNFT is ERC721Enumerable,  Ownable {
    struct Metadata {
        string title;
        string domain;
        bool flat;
        uint16 amount;
        uint16 minCartTotal;
        uint16 maxDiscountedAmount;
        uint8 canUse;
        bool sold;
        uint8 applied;
    }

    mapping(uint256 => Metadata) idToCoupon;

    constructor() ERC721("CodeCloudsNFT", "CCNFT") {
    }

    function mint(
        string memory domain,
        bool flat,
        uint16 amount,
        uint16 minCartTotal,
        uint16 maxDiscountedAmount,
        uint8 canUse
    ) public onlyOwner {
        uint256 couponId = getCouponId();
        string memory title = generateTitle(domain, Strings.toString(couponId));
        idToCoupon[couponId] = Metadata(
            title, 
            domain, 
            flat, 
            amount, 
            minCartTotal, 
            maxDiscountedAmount, 
            canUse,
            false,
            0
        );
        _safeMint(msg.sender, couponId);
    }

    function bulkMint(
        string memory domain,
        bool flat,
        uint16 amount,
        uint16 minCartTotal,
        uint16 maxDiscountedAmount,
        uint8 canUse,
        uint256 count
    ) public onlyOwner {
        for (uint256 index = 0; index < count; index++) {
            mint(domain, flat, amount, minCartTotal, maxDiscountedAmount, canUse);
        }
    }

    function getCouponId() internal view returns (uint256) {
        return totalSupply() + 1;
    }

    function generateTitle(string memory domain, string memory id) internal pure returns (string memory){
        return string(abi.encodePacked(domain, '#', id));
    }

    function isOwner(address sender) public view returns (bool){
        return owner() == sender;
    }

    function get(uint256 tokenId) external view returns (
        string memory title,
        string memory domain,
        bool flat,
        uint16 amount,
        uint16 minCartTotal,
        uint16 maxDiscountedAmount,
        uint8 canUse,
        bool sold,
        uint8 applied
    ) {
        require(_exists(tokenId), "token not minted");
        Metadata memory coupon = idToCoupon[tokenId];
        title = coupon.title;
        domain = coupon.domain;
        flat = coupon.flat;
        amount = coupon.amount;
        minCartTotal = coupon.minCartTotal;
        maxDiscountedAmount = coupon.maxDiscountedAmount;
        canUse = coupon.canUse;
        sold = coupon.sold;
        applied = coupon.applied;
    }

    function buy(uint256 tokenId) external payable {
        require(ownerOf(tokenId) == owner(), string(abi.encodePacked(symbol(), ' is not transferable')));
        require(msg.value == 0.02 ether, "Invalid Price");
        _transfer(owner(), msg.sender, tokenId);
        payable(owner()).transfer(20 wei);
        idToCoupon[tokenId].sold = true;
    }

    function usedCoupon(uint256 tokenId, address sender) external {
        require(ownerOf(tokenId) == sender, 'Owner Mismatch');
        idToCoupon[tokenId].applied += 1;
    }

}
